import React from 'react';
import logo from './logo.svg';
import './App.css';


const App= ()=> {
  return (
    <div className="App">
      <header className="App-header">
        <nav>logoHere</nav>
       <wallet></wallet>
        <p>
          Edit <code>src/App.js</code> and save to reload.hhhhh
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
